import {useState, useEffect} from "react";
import useFetch from "./useFetch";

const Form = () => {
    const [kiosks, setKiosks] = useState(null)
    
    useEffect(() => {
        fetch('http://localhost:8000/kisok')
        .then(res => {
            return res.json();
        })
        .then(data => {
            setKiosks(data);
        })
    }, [])
    //const { error, isPending, data: kiosks } = useFetch('http://localhost:8000/kiosk');

    return ( 
        <div>
            {kiosks.map(kiosk => (
                <div>
                <h2>{kiosk.name}</h2>
                <h2>{kiosk.latitude}</h2>
                <h2>{kiosk.longitude}</h2>
                </div>
            ))}
        </div>
     );
}
 
export default Form;
